\u7FFB\u8BD1\u4E00\u4E0B\uFF1AValueOf\u7528\u6765\u83B7\u53D6\u8F93\u5165\u53C2\u6570\u63A5\u53E3\u4E2D\u7684\u6570\u636E\u7684\u503C\uFF0C\u5982\u679C\u63A5\u53E3\u4E3A\u7A7A\u5219\u8FD4\u56DE0


// TypeOf returns the reflection Type that represents the dynamic <span class="token builtin class-name">type</span> of i.
